  return (
    <div data-testid="home-page">
      <Logo/>
      <h1>Seu <span className='gradient'>duo</span> está aqui.</h1>
      <GridGames/>
      <Dialog.Root>
        <BoxAnnouncement/>
        <Dialog.Portal>
          <Dialog.DialogOverlay className='teste'/>

          <Dialog.Content>
            <Dialog.DialogTitle>Publique um anúncio</Dialog.DialogTitle>

            <Dialog.Content>
              <p>teste</p>
            </Dialog.Content>
          </Dialog.Content>
        </Dialog.Portal>
      </Dialog.Root>
    </div>
  );
}
